import React,{Component} from 'react';
import {Redirect} from 'react-router-dom';
//import './login.css';
import axios from 'axios';



class Login extends Component {
    constructor(props)
    { super (props)
        this.state={
            username:'',
            password:''

        }

    }
    changeHandler= e=>{
        this.setState({[e.target.name]:e.target.value})
    }
    submitHandler= e=>{
    e.preventDefault()
    console.log(this.state)
    axios.post('http://8d9bca34.ngrok.io/',this.state)
    .then(response=> {

        console.log(response)

    })
    .catch(error=> {

        console.log(error)

    })

    }
    state = {
        redirect: false
    } 
    setRedirect = () =>{
        this.setState({
            redirect:true
        })
    }
    renderRedirect = ()=> {
        if(this.state.redirect){
            return <Redirect to='/check'/>
        }
    }
    render() {
        const{username,password} =this.state
        return ( 

      <div>  


<div >

                <img src={require("/home/nineleaps/Desktop/onproject/onproject/src/Component/pages/Login/nineleaps-logo@3x.png")}
                 width ="120"
                 height= "50"

                 />

                 <nav id="head">
                onboarding 
                </nav>
            </div>
              <div >

              <div className="fullform">
                     <form  onSubmit={this.submitHandler} >
                     <div  >
                            <p>Email</p>
                            <input type="text" name="username" value={username} onChange={this.changeHandler} placeholder="Email address" style={{width:"350px"}}/>
                     </div>
                        <div  >
                        <p>Password</p>

                        <input type="password" name="password" className="pass" value={password} onChange={this.changeHandler} placeholder="Password" style={{width:"350px"}}/>
                        </div>

                         <div > 
                            <input type="checkbox" class="form-check-input" id="exampleCheck1" />
                         <label class="form-check-label" for="exampleCheck1">Check me out</label>
                        </div> 

                    <div >


                    {this.renderRedirect()}
                    <button type="submit" onClick={this.setRedirect} style={{backgroundColor:"#007bff"  }}>Login</button>
                     </div>

    </form>
    </div>
    <div class="footer">
                    <p>Nineleaps</p>
            </div>

    </div></div>





        );

    }
    }

export default Login;
